import React from 'react'
import { BrowserRouter, NavLink } from 'react-router-dom/cjs/react-router-dom';

const RegisteredSuccessful = ()=>{
    return(
        <div>
            <h2>Registration Successful...</h2>
            <p>Click for <NavLink to="/" style={{color:'white'}}>SignIn</NavLink>.</p>
        </div>
    )
}

export default RegisteredSuccessful
